import React from "react";
import AcUnitIcon from '@mui/icons-material/AcUnit';
import MenuIcon from '@mui/icons-material/Menu';

function Header() {
  return (
    <div>
      <h1>I am a header</h1>
      <AcUnitIcon />
    </div>
  );
}

export default Header;
